import { useState } from "react";
import "./App.css";
import InputParty from "./components/InputParty";
import PartyList from "./components/PartyList";

function App() {
  const [peoples, setPeoples] = useState([
    {
      name: "Joao",
      age: 18,
    },
    {
      name: "maria",
      age: 8,
    },
    {
      name: "pedro",
      age: 48,
    },
    {
      name: "fernando",
      age: 15,
    },
    {
      name: "gui",
      age: 35,
    },
    {
      name: "julia",
      age: 41,
    },
  ]);

  return <div className="App">
    <InputParty peoples={peoples} setPeoples={setPeoples}  />
    <PartyList peoples={peoples} />
  </div>;
}

export default App;
